const TeacherView = (teacher) => {

    const { teacherId } = location.state;

    return (
        <>
        <TopBar/>
        <Container className="styled-container">
            <h1>teacher.PrimaryInstructor</h1>
        </Container>
        </>
    );
};

export default TeacherView;
